<!DOCTYPE html>
<html lang="en">

<head>
    <title>Election Results Template</title>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <script src="https://code.jquery.com/jquery-3.2.1.min.js"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/handlebars.js/4.7.6/handlebars.min.js"></script>
    <style>
        body {
        margin: 10% 0 0 10%;
    }

    div, table {
        /*width: 95px;
        table-layout: fixed;
        border-collapse: collapse;*/
        font-family: sans-serif;
        font-size: 8px;
    }

    .race-title {
        font-weight: bold;
        display: block;
        border-top: 1px solid #1a1a1a;
        width: 130px;
        margin-top: 5px;
        margin-bottom: 2px;
        padding-top: 2px;
    }

    tr {
        line-height: 7px;
    }

    #col-1 {
        width: 9px;
        margin-right: 1px;
    }
    #col-2 {
        width: 8px;
        margin-right: 2px;
    }
    #col-3 {
        width: 88px;
        margin-right: 2px;
    }
    #col-4 {
        width:25px;
        float: right;
        text-align: right;
    }

    #container {
        width: 130px;
    }
</style>
</head>

<body>
    <div id="displayArea"></div>
    <!-- <script id="myTemplate" type="text/x-handlebars-template">
        {{#each results}}
        <h1>Employee Name : {{this.name}}, Age : {{this.age}}</h1>
        {{/each}} -->
    <script id="myTemplate" type="text/x-handlebars-template">
        {{#each results}}
            {{#if officename}}
                <span class="race-title">{{this.officename}} {{this.seatname}}</span>
            {{/if}}
            <div id="container">
                {{#if winner}}
                <span id="col-1">&#10004;</span>
                {{else}}
                <span id="col-1">&nbsp;&nbsp;&nbsp;</span>
                {{/if}}
                {{#ifEquals party "Dem"}}
                <div id="col-2" style="width:5px;height:5px;background-color:#009ac9;margin-top:2px;display:inline-block"></div>
                {{else}}
                <div id="col-2" style="width:5px;height:5px;background-color:#f04e41;margin-top:2px;display:inline-block"></div>
                {{/ifEquals}}
                <span id="col-3">{{this.firstname}} {{this.lastname}}</span>
                <span id="col-4">{{this.votepercent}}</span>
            </div>
        {{/each}}
    </script>

    var tmpHtml = document.getElementById("myTemplate").innerHTML;
    var template = Handlebars.compile(tmpHtml);
    Handlebars.registerHelper('ifEquals', function(arg1, arg2, options) {
        return (arg1 == arg2) ? options.fn(this) : options.inverse(this);
    });
